    "@type": "dbo:PopulatedPlace",
    "label": {
      "@value": "« Jardinons ensemble à Limoges »  est une jeune association de jardiniers de tous âges. Cette association crée en  janvier 2012 est née de la volonté de jeunes jardiniers,  particulièrement sensibles aux problèmes écologiques de la planète, qui a pour projet de faire vivre une utopie : jardiner ensemble dans  la convivialité et dans un esprit de partage et  de solidarité.\n\nL’association a pour objet de mettre en valeur et de cultiver collectivement des terres urbaines inexploitées en appliquant les principes du jardinage biologique, en partageant les tâches et les savoir-faire, avec éthique, dans un esprit de convivialité, de bonne humeur et de partage intergénérationnel. Nous cultivons actuellement  un jardin de 300 m2 rue de la Roche au GO à Limoges.\n\nIncroyables comestibles\nLe collectif limougeaud est né du réseau international. L'idée est de dévellopper et soutenir les actions d'Incroyables comestibles à Limoges, soit créer l'abondance de nourriture saine à profusion en plantant des fruits, légumes dans l'espace public et en les partageant gratuitement, pour le plaisir !",
      "@language": "fr"
    },
    "lat": 45.825196,
    "long": 1.264275,
    "source": [
      "http://PWA/SKOS/alternatiba"
    ],
    "abstract": "« Jardinons ensemble à Limoges »  est une jeune association de jardiniers de tous âges. Cette association crée en  janvier 2012 est née de la volonté de jeunes jardiniers,  particulièrement sensibles aux problèmes écologiques de la planète, qui a pour projet de faire vivre une utopie : jardiner ensemble dans  la convivialité et dans un esprit de partage et  de solidarité.\n\nL’association a pour objet de mettre en valeur et de cultiver collectivement des terres urbaines inexploitées en appliquant les principes du jardinage biologique, en partageant les tâches et les savoir-faire, avec éthique, dans un esprit de convivialité, de bonne humeur et de partage intergénérationnel. Nous cultivons actuellement  un jardin de 300 m2 rue de la Roche au GO à Limoges.\n\nIncroyables comestibles\nLe collectif limougeaud est né du réseau international. L'idée est de dévellopper et soutenir les actions d'Incroyables comestibles à Limoges, soit créer l'abondance de nourriture saine à profusion en plantant des fruits, légumes dans l'espace public et en les partageant gratuitement, pour le plaisir !",
