      "@value": "L'association Les enfants terribles anime des ateliers cirque et théâtre de rue tout au long de l'année à Isle et Limoges (centre culturel Jean-le-bail dans le cadre des ateliers péri-scolaires en Haute-Vienne). Les enfants terribles c'est aussi une troupe une troupe de spectacle de rue d'enfants (12-17 ans) qui se rencontrent sur plusieurs week-end de travail puis à Pâques sur une semaine de création spectacle. Les enfants partent en tournée l'été et de village en village jouent leur spectacle. Ils jouent également sur des festivals (Urbaka...). L'association organise une colonie de vacances en juillet sur le principe de la troupe Saltimbanque en Limousin : on monte un spectacle la première semaine et on le tourne la deuxième à pied de village en village comme les troubadours d'antan.",
